import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";


export default function Login() {
    return (
        <React.Fragment>

                <div className="d-flex flex-row justify-content-center h-100 position-relative">
                    <div className="body-container mt-5">
                        <LoginBody />
                    </div>
                </div>
        </React.Fragment>
    )
}
